INSERT INTO `programas` (`id`, `nome`, `subtitulo`, `resumo`, `apresentacao`, `ativo`, `dt_cadastro`) VALUES
(1, 'horizonte4zeros', ' desenvolvimento urbano em jaguarão: ampliando fronteiras do saber', 'O programa se articula assumindo demandas dos gestores públicos municipais, particularmente da Prefeitura Municipal, secretarias de Planejamento Urbano e de Cultura de Jaguarão, identificadas mediante atividades de colaboração preexistentes com a UFPel, que incluem suporte à preservação patrimonial, ensino de planejamento urbano e construção de cenários de futuro, em ações com professores, alunos e técnicos das instituições.', 'O programa se articula assumindo demandas dos gestores públicos municipais, particularmente da Prefeitura Municipal, secretarias de Planejamento Urbano e de Cultura de Jaguarão, identificadas mediante atividades de colaboração preexistentes com a UFPel, que incluem suporte à preservação patrimonial, ensino de planejamento urbano e construção de cenários de futuro, em ações com professores, alunos e técnicos das instituições.', 'S', '0000-00-00 00:00:00');

