INSERT INTO `projetos` (`id`, `nome`, `resumo`, `objetivos`, `mapeamento`, `problemajustificacao`, `fundamentos`, `resultados`, `programa_id`, `dt_cadastro`) VALUES
(1, 'DRUP em Jaguarão', 'reuniões de preparação: fazem parte da rotina dos membros da equipe executora, podendo contar com\na participação dos técnicos envolvidos e representantes da comunidade em geral.\n', 'Apresentação', NULL, 'a realização de diagnósticos tem sido uma das atividades iniciais e estruturantes dos trabalhos com as\ncidades, os quais podem ser realizados de diferentes modos. De modo a complementar os diagnósticos\ntradicionais (realizado pela Prefeitura ao elaborar o Plano Diretor e pela UFPel ao construir e analisar o\nSistema de Informações Geográficas, em projeto de extensão atual), este projeto propõe um diagnóstico\nfundado nas cognições dos usuários do espaço, de modo participativo e dedicado à visualização da\ninformação. Nesse caminho, o Diagnóstico Rápido Participativo Urbano, conhecido pela sigla DRUP, está\nproposto como passo inicial do programa, construindo visão ampla e integradora dos diversos aspectos da\ncidade.', 'fundamentos 1', 'resumo 1', 1, '2013-04-29 15:59:22'),
(2, 'Ordenamento Urbano', 'produção de material didático: é etapa na qual a equipe e os participantes do projeto discutem e\nconfeccionam os materiais necessários para as ações previstas no projeto, visando atender os objetivos\npropostos.\n', 'objetivos 2', NULL, 'Ordenamento do núcleo urbano consolidado: a cidade teve seu Plano Diretor aprovado recentemente,\nSIGProj - Página 6 de 34\nao que se seguiu o tombamento pelo IPHAN de toda a área central, entorno e cerca de 650 prédios.\nNesse processo, restaram diversas incongruências entre os dois instrumentos de planejamento e controle\nurbanos, bem como entre eles e a realidade da cidade. Além disso, a cidade experimenta efetivo surto de\ncrescimento, ocasionado pelos novos pólos de atração e pelos investimentos locais, o que indica a\noportunidade de estudar a estrutura intraurbana e de compatibilizar os mecanismos para seu planejamento\ne desenho urbano.', 'fundamentos 2', 'resumo 2', 1, '2013-04-29 15:59:56'),
(3, 'Jaguarão cidade paraformal', ' aulas teóricas: são momentos de estudo dos grupos envolvidos, em que se pretende um processo de\ncomunicação e troca de saberes. \n', 'objetivos 3', NULL, 'Jaguarão cidade paraformal: áreas do conhecimento como a economia e o urbanismo têm consolidado\no uso das categorias de “cidade formal e informal”, da “economia formal e informal”. Esses pares de\nopostos têm ocupado os meios de comunicação e forjado ou fingido um debate sobre “o que é” e “o que\nnão é” a cidade e a urbanidade, polaridade conceitual que parecia constituir um dentro e um fora\ncompletamente definidos e um congelamento das complexas relações urbano-ecológicas. Partindo desses\nestereótipos a proposta de extensão “Jaguarão cidade para-formal” pretende experimentar categorias\nalternativas para explorar o campo do meio, da zona cinza, gradual e complexa. Neste sentido, está sendo\nusado o neologismo “para-formal” (na fronteira), artificial e provisório, algo relativo à forma, porém não é\nela mesma, evitando tomar o formal e o informal como adjetivos fixos. A idéia é introduzir alternativas\nlocais e específicas, tornando mais “reais” os processos de “formação, transformação, deformação e\nin-formação”.', 'fundamentos 3', 'resumo 3', 1, '2013-04-29 16:00:26'),
(4, 'Cromática de Jaguarão', 'exposições: pretendem apresentação de resultados, parciais ou finais, ao público em geral; incluem\nmapas, imagens, vídeos e outros materiais produzidos durante a execução do projeto de extensão.', 'objetivos 4', NULL, 'Estrutura cromática de Jaguarão: os estudos cromáticos sustentam a criação de instrumentos\nurbanísticos de diversos tipos e níveis, desde os planos e projetos aos regulamentos e catálogos ou atlas\ncromáticos, manuais, elucidários, cadernos de encargos-tipo, etc - os que se necessitem, ou que se\ndemonstrem mais adequados. Os estudos desse tipo são fundamentais para cidades tombadas, como a\nde Jaguarão, ajudando a sustentar o tombamento de forma qualificada. Aparece, assim, o panorama das\npossibilidades de intervenção, articulando a interpretação crítica das análises realizadas com os objetivos\nda ideologia da conservação patrimonial, no quadro dos seus atuais paradigmas.', 'fundamentos 4', 'resumo 4', 1, '2013-04-29 16:00:48');

